import React, { useEffect, useState } from "react";
import signalRService from "../services/signalRService";

const TerminalComponent = () => {
  const [legs, setLegs] = useState([]);

  useEffect(() => {
    const startSignalRConnection = async () => {
      await signalRService.startConnection();

      // Handle flightReceived event
      signalRService.addFlightReceivedListener((flight) => {
        console.log("Received flight:", flight);
        updateLeg(flight.currentLeg, flight.flightNumber);
      });

      // Handle flightRemove event
      signalRService.addFlightRemoveListener((flightId) => {
        console.log("Removed flight:", flightId);
        removeFlight(flightId);
      });

      // Handle flightMove event
      signalRService.addFlightMoveListener((flightId, updatedLeg) => {
        console.log(`Moved flight: ${flightId} - ${updatedLeg}`);
        moveFlight(flightId, updatedLeg);
      });
    };

    startSignalRConnection();
  }, []);

  const initializeLegs = () => {
    const initialLegs = [
      { legNumber: 1, flightNumbers: [] },
      { legNumber: 2, flightNumbers: [] },
      { legNumber: 3, flightNumbers: [] },
      { legNumber: 4, flightNumbers: [] },
      { legNumber: 9, flightNumbers: [] },
      { legNumber: 8, flightNumbers: [] },
      { legNumber: 5, flightNumbers: [] },
      { legNumber: 7, flightNumbers: [] },
      { legNumber: 6, flightNumbers: [] },
    ];
    setLegs(initialLegs);
  };

  const updateLeg = (legNumber, flightNumber) => {
    setLegs((prevLegs) =>
      prevLegs.map((leg) =>
        leg.legNumber === legNumber ? { ...leg, flightNumbers: [...leg.flightNumbers, flightNumber] } : leg
      )
    );
  };

  const moveFlight = (flightId, updatedLeg) => {
    setLegs((prevLegs) =>
      prevLegs.map((leg) =>
        leg.flightNumbers.includes(flightId)
          ? { ...leg, flightNumbers: leg.flightNumbers.filter((flightNumber) => flightNumber !== flightId) }
          : leg
      )
    );
    updateLeg(updatedLeg, flightId);
  };

  const removeFlight = (flightId) => {
    setLegs((prevLegs) =>
      prevLegs.map((leg) =>
        leg.flightNumbers.includes(flightId)
          ? { ...leg, flightNumbers: leg.flightNumbers.filter((flightNumber) => flightNumber !== flightId) }
          : leg
      )
    );
  };

  useEffect(() => {
    initializeLegs();
  }, []);

  return (
    <div className="terminal">
      <div className="line">
        {legs.slice(0, 5).map((leg) => (
          <div className={`leg ${getLegClassName(leg.legNumber)}`} key={leg.legNumber}>
            <h2>Leg {leg.legNumber}</h2>
            {leg.flightNumbers.length > 0 ? (
              <ul className="flight-list">
                {leg.flightNumbers.map((flightNumber) => (
                  <li key={flightNumber}>Flight: {flightNumber}</li>
                ))}
              </ul>
            ) : (
              <p>No flights</p>
            )}
          </div>
        ))}
      </div>
      <div className="line">
       
      <div className={`leg ${getLegClassName(8)}`} key={8}>
  <h2>Leg 8</h2>
  {legs[8] && legs[8].flightNumbers && legs[8].flightNumbers.length > 0 ? (
    <ul className="flight-list">
      {legs[8].flightNumbers.map((flightNumber) => (
        <li key={flightNumber}>Flight: {flightNumber}</li>
      ))}
    </ul>
  ) : (
    <p>No flights</p>
  )}
</div>

        <div className={`leg ${getLegClassName(5)}`} key={5}>
          <h2>Leg 5</h2>
          {legs[5] && legs[8].flightNumbers && legs[5].flightNumbers.length > 0 ? (
    <ul className="flight-list">
      {legs[5].flightNumbers.map((flightNumber) => (
        <li key={flightNumber}>Flight: {flightNumber}</li>
      ))}
    </ul>
  ) : (
    <p>No flights</p>
  )}
        </div>
      </div>
      <div className="line">
        <div className={`leg ${getLegClassName(7)}`} key={7}>
          <h2>Leg 7</h2>
          {legs[7] && legs[7].flightNumbers && legs[7].flightNumbers.length > 0 ? (
    <ul className="flight-list">
      {legs[8].flightNumbers.map((flightNumber) => (
        <li key={flightNumber}>Flight: {flightNumber}</li>
      ))}
    </ul>
  ) : (
    <p>No flights</p>
  )}
        </div>
        <div className={`leg ${getLegClassName(6)}`} key={6}>
          <h2>Leg 6</h2>
          {/* ... */}
        </div>
      </div>
    </div>
  );
};

export default TerminalComponent;

function getLegClassName(legNumber) {
  switch (legNumber) {
    case 1:
      return "first-leg";
    case 2:
      return "second-leg";
    case 3:
      return "third-leg";
    case 4:
      return "fourth-leg";
    case 5:
      return "fifth-leg";
    case 6:
      return "sixth-leg";
    case 7:
      return "seventh-leg";
    case 8:
      return "eighth-leg";
    case 9:
      return "ninth-leg";
    default:
      return "";
  }
}
